import styles from '../styles/Home.module.css';
import React, { Component } from 'react';

class AcademicProjects extends Component {
    state = {
        academic_projects_list: [
            {
                "id": 0,
                "name": "Portfolio",
                "category": "Front-end Web Development",
                "description": "Personal portfolio that showcases my notable software projects.",
                "technologies": ["next.js", "react.js", "JSX", "TypeScript", "HTML5", "CSS", "Git", "GitHub"],
                "Source": "https://github.com/bud-smith/Portfolio"
            }
        ]
    }

    render() {
        return (
            <div id="academic-projects" className="project-div">
                <h1 className="centre-text">Academic Projects</h1>
                <p className="centre-text">This is a set of my notable academic projects/assignments.</p>
            </div>
        );
    }
}

export default AcademicProjects;
